import Header from '../Header/Header';
import GridContainer from '../GridContainer';
import { ReactComponent as ArrowBack } from '../../assets/images/arrowback.svg';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import axios from 'axios';


const Profile = () => {
  const [profileData, setProfileData] = useState({
    email: '',
    avatar: '',
    userName: '',
    course: '',
    group: '',
    faculty: '',
    chair: '',
    specialBlock: '',
    special: '',
    educationProgramm: '',
    studyLevel: '',
    studyForm: '',
    cost: '',
    userId: '' // Add userId field
});

const handleChange = (e: { target: { name: any; value: any; }; }) => {
    const { name, value } = e.target;
    setProfileData({
        ...profileData,
        [name]: value
    });
};

const handleSubmit = async (e: { preventDefault: () => void; }) => {
    e.preventDefault();
    try {
        const response = await axios.post('http://localhost:5000/api/profile', profileData, { withCredentials: true });
        console.log('Profile created:', response.data);
    } catch (error) {
        console.error('Error creating profile:', error);
    }
};

  return (
    <div>
      <Header />
      <div className='hello'>
        <div id='hello'>Ваш профіль:</div>
        <Link to='/'>
          <div className='back'>
            <ArrowBack />
            Назад
          </div>
        </Link>
      </div>
      <div className='content'>
        <div className='avatar'>
        <img className='ava' alt='avatar' src='https://images.unsplash.com/photo-1468253327312-8e5850c46752?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D'></img>          <div className='changeAva'>Змінити фото</div>
        </div>
        <GridContainer>
          <div>
            <div className="grid-item">ПІБ</div>
            <div className="grid-item">Курс</div>
            <div className="grid-item">Група</div>
            <div className="grid-item">Факультет/інститут</div>
            <div className="grid-item">Кафедра</div>
            <div className="grid-item">Спеціалізація/пропозиція/блок</div>
            <div className="grid-item">Спеціальність</div>
            <div className="grid-item">Освітня програма</div>
            <div className="grid-item">Рівень навчання</div>
            <div className="grid-item">Форма навчання</div>
            <div className="grid-item">Оплата</div>
          </div>

          <div>
          <div className="grid-item">Юдін К.В.</div>
          <div className="grid-item">4</div>
          <div className="grid-item">ІКМ-220Б</div>
          <div className="grid-item">Навчально-науковий інститут комп'ютерного моделювання, прикладної фізики та математики</div>
          <div className="grid-item">Математичне моделювання та інтелектуальні обчислення в інженерії</div>
          <div className="grid-item">Моделювання процесів, обробка та аналіз даних</div>
          <div className="grid-item"> </div>
          <div className="grid-item">Комп`ютерні науки. Моделювання, проектування та комп'ютерна графіка</div>
          <div className="grid-item">Бакалавр</div>
          <div className="grid-item">Денна</div>
          <div className="grid-item">Бюджет</div>
          </div>
          </GridContainer>
          
          </div>

          <form onSubmit={handleSubmit}>
            <input type="text" name="email" value={profileData.email} onChange={handleChange} placeholder="Email" />
            <input type="text" name="avatar" value={profileData.avatar} onChange={handleChange} placeholder="Avatar" />
            <input type="text" name="userName" value={profileData.userName} onChange={handleChange} placeholder="User Name" />
            <input type="text" name="course" value={profileData.course} onChange={handleChange} placeholder="Course" />
            <input type="text" name="group" value={profileData.group} onChange={handleChange} placeholder="Group" />
            <input type="text" name="faculty" value={profileData.faculty} onChange={handleChange} placeholder="Faculty" />
            <input type="text" name="chair" value={profileData.chair} onChange={handleChange} placeholder="Chair" />
            <input type="text" name="specialBlock" value={profileData.specialBlock} onChange={handleChange} placeholder="Special Block" />
            <input type="text" name="special" value={profileData.special} onChange={handleChange} placeholder="Special" />
            <input type="text" name="educationProgramm" value={profileData.educationProgramm} onChange={handleChange} placeholder="Education Program" />
            <input type="text" name="studyLevel" value={profileData.studyLevel} onChange={handleChange} placeholder="Study Level" />
            <input type="text" name="studyForm" value={profileData.studyForm} onChange={handleChange} placeholder="Study Form" />
            <input type="text" name="cost" value={profileData.cost} onChange={handleChange} placeholder="Cost" />
            <input type="text" name="userId" value={profileData.userId} onChange={handleChange} placeholder="User ID" />
            <button type="submit">Create Profile</button>
        </form>
    </div>
  );
};

export default Profile;
